import Pdf from '../Resume.pdf'
import pic from '../images/resume.png'



const Resume = () => {

  const onResumeClick = () => {
    window.open(Pdf)
  }

  return(
    <div>
      <h1>my resume</h1>
      <div className="res-cont" >
        <a onClick={onResumeClick}><img className='resumepng' src={pic} alt="Corys Resume"/></a>
      </div>
    </div>
  )
}
export default Resume
